        private void backgroundWorker1_RunWorkerCompleted(object sender, RunWorkerCompletedEventArgs e)
        {
            DateTime now = DateTime.Now;
            Double elapsed = (now - this.Start).TotalSeconds;
            Double Mbps = this.inMegabits / elapsed;
            SetComplete(Mbps);
            this.label4.Visible = true;
            this.label4.Enabled = true;
            this.label4.BringToFront();
            this.label5.Visible = true;
            this.label5.Enabled = true;
            this.label5.BringToFront();
            if (File.Exists(this.filepath))
            {
                File.Delete(this.filepath);
            }
        }
        private void backgroundWorker1_DoWork(object sender, DoWorkEventArgs e)
        {
            if (backgroundWorker1.CancellationPending)
            {
                return;
            }
            if (File.Exists(this.filepath))
            {
                File.Delete(this.filepath);
            }
            this.client = new Client(this.uri, this.filepath);
            this.Start = this.client.Start;
            while (this.client.IsBusy)
            {
                SetProgress(this.client.Received);
            }
        }
        public int GetTextWidth(string text)
        {
            SizeF size_f = Graphics.FromImage(new Bitmap(1, 1)).MeasureString(text, new Font("-apple-system, BlinkMacSystemFont, \"Segoe UI\", Helvetica, Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\"", 14));
            int width = Convert.ToInt32(Math.Ceiling(Convert.ToDouble(size_f.Width)));
            return width;
        }
        protected void SetComplete(Double mbps)
        {
            if (this.ProgressBar1.InvokeRequired)
            {
                this.ProgressBar1.Invoke(new MethodInvoker(() =>
                {
                    this.ProgressBar1.Value = Convert.ToInt32(this.contentLength);
                }));
            }
            else
            {
                this.ProgressBar1.Value = Convert.ToInt32(this.contentLength);
            }
            if (this.label1.InvokeRequired)
            {
                this.label1.Invoke(new MethodInvoker(() =>
                {
                    this.label1.Text = this.contentLengthMB.ToString("00.00") + " MB";
                }));
            }
            else
            {
                this.label1.Text = this.contentLengthMB.ToString("00.00") + " MB";
            }
            if (this.label5.InvokeRequired)
            {
                this.label5.Invoke(new MethodInvoker(() =>
                {
                    this.label5.Text = mbps.ToString("00.00") + " Mbps";
                }));
            }
            else
            {
                this.label5.Text = mbps.ToString("00.00") + " Mbps";
            }
            if (this.button2.InvokeRequired)
            {
                this.button2.Invoke(new MethodInvoker(() =>
                {
                    this.button2.Visible = true;
                    this.button2.Enabled = true;
                }));
            }
            else
            {
                this.button2.Visible = true;
                this.button2.Enabled = true;
            }
        }
        protected void SetProgress(Double value)
        {
            Double received = this.client.Received;
            Double receivedMB = this.client.ReceivedMB;
            Double Mbps = this.client.Rate;
            if (this.ProgressBar1.InvokeRequired)
            {
                this.ProgressBar1.Invoke(new MethodInvoker(() =>
                {
                    this.ProgressBar1.Value = Convert.ToInt32(received);
                }));
            }
            else
            {
                this.ProgressBar1.Value = Convert.ToInt32(received);
            }
            if (this.label1.InvokeRequired)
            {
                this.label1.Invoke(new MethodInvoker(() =>
                {
                    this.label1.Text = receivedMB.ToString("00.00") + " MB";
                }));
            }
            else
            {
                this.label1.Text = receivedMB.ToString("00.00") + " MB";
            }
            if (this.label3.InvokeRequired)
            {
                this.label3.Invoke(new MethodInvoker(() =>
                {
                    this.label3.Text = Mbps.ToString("00.00") + " Mbps";
                }));
            }
            else
            {
                this.label3.Text = Mbps.ToString("00.00") + " Mbps";
            }
        }
