    public class Client : WebClient
    {
        public string Uri
        {
            get;
            set;
        }
        public string FilePath
        {
            get;
            set;
        }
        public Double Percent = 1;
        public Double ContentLength = 1;
        public Double ContentLengthMB { get; set; }
        public Double Received = 1;
        public Double ReceivedMB = 1;
        public Double ReceivedMbits = 1;
        public Double SecondsElapsed = 1;
        public Double Rate = 1;
        public DateTime Start { get; set; }
        public Client()
        {
            this.Headers.Add("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/97.0.4692.71 Safari/537.36");
            this.DownloadProgressChanged += new DownloadProgressChangedEventHandler(Client_DownloadProgressChanged);
        }
        public Client(string uri, string filepath)
        {
            this.Headers.Add("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/97.0.4692.71 Safari/537.36");
            this.Uri = uri;
            this.FilePath = filepath;
            this.DownloadProgressChanged += new DownloadProgressChangedEventHandler(Client_DownloadProgressChanged);
            this.Start = DateTime.Now;
            this.DownloadFileAsync(new Uri(this.Uri), this.FilePath);
        }
        private void Client_DownloadProgressChanged(object sender, DownloadProgressChangedEventArgs e)
        {
            DateTime now = DateTime.Now;
            this.SecondsElapsed = (now - this.Start).TotalSeconds;
            this.Received = e.BytesReceived;
            if (this.ContentLength == 1)
            {
                this.ContentLength = e.TotalBytesToReceive;
                this.ContentLengthMB = e.TotalBytesToReceive / 1048576;
            }
            this.Percent = e.ProgressPercentage;
            this.ReceivedMB = this.Received / 1048576;
            this.ReceivedMbits = this.ReceivedMB * 8;
            this.Rate = this.ReceivedMbits / this.SecondsElapsed;
        }
    }
    public class ChangeUri
    {
        public static Font SegoeUI = new Font("-apple-system, BlinkMacSystemFont, \"Segoe UI\", Helvetica, Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\"", 12);
        public static TextBox textBox;
        public static Label invalidUri;
        public static Label noDownload;
        public static Uri NewUri;
        public static string downloaduri;
        public static Form prompt;
        public static DialogResult result;
        public static void DialogOK(object sender, EventArgs e)
        {
            if (String.IsNullOrEmpty(textBox.Text))
            {
                downloaduri = "https://speed.hetzner.de/1GB.bin";
            }
            else
            {
                try
                {
                    NewUri = new Uri(textBox.Text);
                    downloaduri = NewUri.AbsoluteUri;
                }
                catch
                {
                    invalidUri.Enabled = true;
                    invalidUri.Visible = true;
                }
                if (!String.IsNullOrEmpty(downloaduri))
                {
                    HttpWebRequest request = (HttpWebRequest)WebRequest.Create(downloaduri);
                    request.UserAgent = "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/97.0.4692.71 Safari/537.36";
                    Double contentLength = -1;
                    using (WebResponse response = request.GetResponse())
                    {
                        contentLength = Convert.ToDouble(response.ContentLength);
                    }
                    request.Abort();
                    if(contentLength > 0)
                    {
                        prompt.Close();
                    } else
                    {
                        downloaduri = String.Empty;
                        invalidUri.Enabled = false;
                        invalidUri.Visible = false;
                        noDownload.Enabled = true;
                        noDownload.Visible = true;
                    }
                }
            }
        }
        public static void DialogCancel(object sender, EventArgs e)
        {
            downloaduri = "https://speed.hetzner.de/1GB.bin";
            prompt.Close();
        }
        public static string Dialog(string text, string caption, string phold = null)
        {
            int h = Convert.ToInt32(Math.Round(((Graphics.FromImage(new Bitmap(1, 1))).MeasureString(text, SegoeUI).Height)));
            prompt = new Form()
            {
                Width = 500,
                Height = 200,
                FormBorderStyle = FormBorderStyle.FixedDialog,
                Text = caption,
                StartPosition = FormStartPosition.CenterScreen,
                Font = SegoeUI
            };
            Label textLabel = new Label() { AutoSize = false, Height = h, Left = 50, Top = 20, Width = 400, Text = text, Font = SegoeUI };
            invalidUri = new Label() { AutoSize = false, Height = h, Left = 50, Top = (h + 30), Width = 400, Text = "Invalid url!", Font = SegoeUI, ForeColor = Color.FromName("Red"), Visible = false, Enabled = false };
            noDownload = new Label() { AutoSize = false, Height = h, Left = 50, Top = (h + 30), Width = 400, Text = "This link does not download a file!", Font = SegoeUI, ForeColor = Color.FromName("Red"), Visible = false, Enabled = false };
            textBox = new TextBox() { Size = new Size(400, 100), Left = 50, Top = (h + 60), Font = SegoeUI };
            if (phold != null)
            {
                textBox.Text = phold;
            };
            Button confirmation = new Button() { Text = "Ok", Left = 240, Width = 100, Height= 30, Top = (h + 90), Font = SegoeUI };
            Button cancel = new Button() { Text = "Cancel", Left = 350, Width = 100, Height = 30, Top = (h + 90), Font = SegoeUI, DialogResult = DialogResult.Cancel };
            confirmation.Click += new EventHandler(DialogOK);
            cancel.Click += new EventHandler(DialogCancel);
            prompt.Controls.Add(textBox);
            prompt.Controls.Add(invalidUri);
            prompt.Controls.Add(confirmation);
            prompt.Controls.Add(textLabel);
            prompt.Controls.Add(cancel);
            prompt.Controls.Add(noDownload);
            result = prompt.ShowDialog();
            return downloaduri;
        }
    }
